import React, { useState, useEffect } from 'react';

function App() {
  const [isAuthenticated, userHasAuthenticated] = useState(false);

  return !isAuthenticated ? (
    <div>
      <h1>Not Authenticated</h1>
    </div>
  ) : (
    <div>
      <h1>Authenticated</h1>
    </div>
  );
}

export default App;
